import './App.css';
import LoginSection from './LoginSection.jsx'
import HomeNoneAuth from './HomeNoneAuth.jsx'
import Home from './Home.jsx'
import { BrowserRouter, Routes, Route, Navigate, useNavigate } from "react-router-dom";


function App() {
  const accesToken = localStorage.getItem('Token')
  const role = localStorage.getItem('Role')

  return (
    <BrowserRouter>
    <Routes>
      <Route path='/login' element={accesToken ? <Navigate to="/home" /> : <LoginSection />}></Route>
      <Route path='/home' element={accesToken ? <Home/> : <Home/> }></Route>
      <Route path='/checkresults' element={accesToken ? <HomeNoneAuth/> : <Home />} ></Route>

    </Routes>
    </BrowserRouter>
  );
}

export default App;
